'''Rock lobsters''' are found in the [[Waterbirth Island Dungeon]]'s fifth sub-level, in Room 16. They are similar to [[giant rock crab]]s in the fact that they are initially disguised as large rocks, but they will attack the player as they approach. They have very high [[Defence]] (though they are weak to [[Magic]] attacks) and can hit up to 15 [[Hitpoints]], but rarely hit over 11 Hitpoints. Their attack speed is as fast as [[dart]]s on [[Rapid]] (they attack every second [[game tick]]), making them incredibly dangerous.

